import React from 'react'
import './UnitsAges.css'

export default function UnitsAges(props) {

const AgesFilterHandler = (event) => {
    event.preventDefault();
    props.onChangeFilter(event.target.textContent);
}

    return (
        <div className='ages'>
        <form value={props.selected} onSubmit={AgesFilterHandler}>
          <input type="submit" value='All'></input>
          <input type="submit" value='Dark'></input>
          <input type="submit" value='Feudal'></input>
          <input type="submit" value='Castle'></input>
          <input type="submit" value='Imperial'></input>
        </form>
        </div>
    )
}
